class AgeWnd extends UICommonAPI;

const 5575 = 148;
const 5574 = 5000;
const 5549 = 149;
const 5227 = 600000;

var WindowHandle 5712;
var TextureHandle 5616;
var WindowHandle HelpHtmlWnd;
var WindowHandle 5581;
var TextureHandle 5578;
var string 5192;
var string 5187;
var string 5093;
var string 5060;
var string 5016;
var string 4823;
var bool 4822;

function OnRegisterEvent()
{
    RegisterEvent(170);
    return;
}

function OnLoad()
{
    25();
    43();
    return;
}

function 25()
{
    
    if(1 == 0)
    {
        OnRegisterEvent();
    }
    if(1 == 0)
    {
        5712 = GetHandle("AgeWnd");
        5616 = TextureHandle(GetHandle("AgeWnd.AgeTex"));
        HelpHtmlWnd = GetHandle("HelpHtmlWnd");
        5581 = GetHandle("HelpHtmlWnd.AgeHelpWnd");
        5578 = TextureHandle(GetHandle("HelpHtmlWnd.AgeHelpWnd.AgeTex"));        
    }
    else
    {
        5712 = GetWindowHandle("AgeWnd");
        5616 = GetTextureHandle("AgeWnd.AgeTex");
        HelpHtmlWnd = GetWindowHandle("HelpHtmlWnd");
        5581 = GetWindowHandle("HelpHtmlWnd.AgeHelpWnd");
        5578 = GetTextureHandle("HelpHtmlWnd.AgeHelpWnd.AgeTex");
    }
    4822 = false;
    return;
}

function 43()
{
    5192 = "L2Font.Skins.kr_rated_15";
    5187 = "L2Font.Skins.kr_rated_18";
    5093 = "";
    5060 = "L2Font.Skins.Help_Age_15";
    5016 = "L2Font.Skins.Help_Age_18";
    4823 = "";
    return;
}

function OnEnterState(name 4820)
{
    if(4820 == 'LoadingState')
    {
        if(!4822)
        {
            522();
        }
    }
    return;
}

function 522()
{
    5712.ShowWindow();
    5616.ShowWindow();
    5712.SetTimer(148, 5000);
    4822 = true;
    5712.SetTimer(149, 600000);
    return;
}

function OnTimer(int 5894)
{   
    if(5894 == 148)
    {
        5712.HideWindow();
        5712.KillTimer(148);        
    }
    else
    {       
        if(5894 == 149)
        {
            4822 = false;
            5712.KillTimer(149);
        }
    }
    return;
}

function OnEvent(int 6875, string 6883)
{
    local int 4527, 4413, 4385;
    local NWindow.UIEventManager.EServerAgeLimit 4376;
   
    if(6875 == 170)
    {        
        if(ParseInt(6883, "ServerAgeLimit", 4527))
        {
            4376 = byte(4527);
            switch(4376)
            {               
                case 0:
                    5616.SetTexture(5192);
                    5578.SetTexture(5060);
                    HelpHtmlWnd.GetWindowSize(4413, 4385);
                    HelpHtmlWnd.SetWindowSize(4413, 501);                   
                    break;               
                case 1:
                    5616.SetTexture(5187);
                    HelpHtmlWnd.GetWindowSize(4413, 4385);
                    HelpHtmlWnd.SetWindowSize(4413, 501);
                    5578.SetTexture(5016);                  
                    break;               
                case 2:               
                default:
                    5616.SetTexture(5093);
                    5616.HideWindow();
                    5581.HideWindow();                  
                    break;
                    break;
            }
        }
    }
    return;
}

#include <bits/stdc++.h>
#include <algorithm>
 
using namespace std;
 
struct User{
    string login;
    string password;
    bool system;
 
    bool operator==(const User& other) const {
        return login == other.login && password == other.password;
    }
};
 
int main(){
    ios::sync_with_stdio(false);
    cin.tie(0);
 
    vector<User> user;
    string command, login, password;
    bool system;
    while (cin >> command){
        if (command == "login"){
            cin >> login >> password;
 
            bool already_logged_in = false, login_in = false;
            int64_t index = -1;
            for (int i = 0; i < user.size(); i++){
                if (user[i].login == login){
                    login_in = true;
                    index = i;
                    break;
                }
            }
            if (login_in && user[index].password == password){
                if (user[index].system == true){
                    cout << "already logged in" << endl;
                }
                else{
                    cout << "logged in" << endl;
                    user[index].system = true;
                }
            }
            else{
                cout << "wrong account info" << endl;
            }
        }
        else if (command == "register"){
            cin >> login >> password;
 
            bool login_in = false;
            for (int i = 0; i < user.size(); i++){
                if (user[i].login == login){
                    login_in = true;
                    break;
                }
            }
 
            if (login_in){
                cout << "login already in use" << endl;
            }
            else{
                User new_user{login, password, false};
                user.push_back(new_user);
                cout << "account created" << endl;
            }    
        }
        else if (command == "logout"){
            cin >> login;
 
            bool login_in = false;
            int64_t index = -1;
            for (int i = 0; i < user.size(); i++){
                if (user[i].login == login){
                    login_in = true;
                    index = i;
                    break;
                }
            }
            if (login_in){
                if (user[index].system == true){
                    cout << "logged out" << endl;
                    user[index].system = false;
                }
                else{
                    cout << "incorrect operation" << endl;
                }
            }
            else{
                cout << "incorrect operation" << endl;
            }
        }
    }
 
    return 0;
}

function createPdfFromRange(){

  var spreadsheetID = "here-your-spreadsheet-id";
  
  //Select the working sheet that you will convert to PDF
  var workingSheet = SpreadsheetApp.openById(spreadsheetID).getSheetByName("Sheet1");

  //Set the default range to whatever you want
  var range = range ? range : "A2:E35";

 /*
 The exportUrl variable is the most relevant part, how to format the range you selected from the working sheet and converted to a full page PDF that you can print later 
 */
 
  var sheetParam = "&gid=" + workingSheet.getSheetId();

  var exportUrl = url.replace(/\/edit.*$/, '')
      + '/export?exportFormat=pdf&format=pdf'
      + '&size=a5'                      //A3/A4/A5/B4/B5/letter/tabloid/legal/statement/executive/folio
      + '&portrait=true'                //true= Potrait / false= Landscape
      + '&scale=2'                      //1= Normal 100% / 2= Fit to width / 3= Fit to height / 4= Fit to Page
      + '&top_margin=0.00'              //All four margins must be set!
      + '&bottom_margin=0.00'           //All four margins must be set!
      + '&left_margin=0.00'             //All four margins must be set!
      + '&right_margin=0.00'           //All four margins must be set!
      + '&gridlines=true'               //true/false
      + '&printnotes=false'             //true/false
      + '&pageorder=1'                  //1= Down, then over / 2= Over, then down
      + '&horizontal_alignment=CENTER'  //LEFT/CENTER/RIGHT
      + '&vertical_alignment=TOP'       //TOP/MIDDLE/BOTTOM
      + '&printtitle=false'             //true/false
      + '&sheetnames=false'             //true/false
      + '&fzr=false'                    //true/false
      + '&fzc=false'                    //true/false
      + '&attachment=false'
	  + '&range=' + range
      + sheetParam
      
    Logger.log('exportUrl=' + exportUrl);

  var params = {
    method: "GET",
    headers: { Authorization: "Bearer " + ScriptApp.getOAuthToken() },
    muteHttpExceptions: true
  };

  var response = UrlFetchApp.fetch(exportUrl, params);

  //Handle error 200
  if (response.getResponseCode() !== 200) {
    throw new Error("Error exporting sheet: " + response.getContentText());
  }

  
  //Give a name to your PDF file, this can be dynamic or fixed, I am using a date for this
  var fileName = "Generated PDF " + Utilities.formatDate(new Date(), "GMT-4", "MM/dd/yyyy");
  
  //This is the target folder ID where the creatd PDF's will be stored
  var folderId = "your-google-drive-folder-id-here";
    
  //Get the target folder by using the previous ID
  var folder = DriveApp.getFolderById(folderId);
  
  //Create the new PDF file from the blob and set a name
  var file = folder.createFile(response.getBlob().setName(fileName));
  
  //You can rename it later
  file.setName(fileName);
	
  //Check that the PDF file was created successfully
  Logger.log(file.getUrl());
  
  //Return the file URL or any other parameter that you may need in another function, this is optional
  return file.getUrl();
}

#include <stdio.h>
#include <math.h>
#include <string.h>

int k;
double sin(double x);
double cos(double x);

int main(){
    float A=0,B=0,i,j,z<1760>;
    char b<1760>;
    printf("\x1b<2J");
    for(;;){
        memset(b,32,1760);
        memset(z,0,7040);
        for(j=0;6.28>j;j+=0.07)
            for(i=0;6.28>i;i+=0.02){
                float c=sin(i),d=cos(j),e=sin(A),f=sin(j),g=cos(A),h=d+2,D=1/(c*h*e+f*g+5),
                l=cos(i),m=cos(B),n=sin(B),t=c*h*g-f*e;
                int x=40+30*D*(l*h*m-t*n),y=12+15*D*(l*h*n+t*m),o=x+80*y,
                N=8*((f*e-c*d*g)*m-c*d*e-f*g-l*d*n);
                if(22>y&&y>0&&x>0&&80>x&&D>z<o>){
                    z<o>=D;
                    b<o>=".,-~:;=!*#$@"<N>0?N:0>;
                }
            }
        printf("\x1b<H");
        for(k=0;1761>k;k++)
            putchar(k%80?b<k>:10);
        A+=0.04;
        B+=0.02;
    }
    return 0;
}

